import React from 'react';

function Levels() {
    for (var i=0; i<100; i++) {
        document.getElementById("levels").append(<button type="button">i</button>);
    }
    return(
        <div id="levels">
            <h1>Hi</h1>
        </div>
    )
}

export default Levels;
